import React, { Fragment } from 'react';
import { SafeAreaView, ScrollView, StyleSheet, Text, View } from 'react-native';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Table, Button, Container, Modal, ModalBody, FormGroup, ModalFooter } from 'reactstrap';

const datos = [
    { id: 1, item: 'Wire clips for PV wire- Heyco S6405' },
    { id: 2, item: 'Black #10 PV wire ' },
    { id: 3, item: 'Red #10 PV wire ' },
    { id: 4, item: '11" Cable Ties UV Black Std. Duty' },
    { id: 5, item: 'MC4 Female' },
    { id: 6, item: 'MC4 Male' },
    { id: 7, item: 'Solar DB Lay in Lugs - GBL-4DBT, 4-14, CU, DB' },
    { id: 8, item: '10-32 bolts ' },
    { id: 9, item: '10-32 star washer' },
    { id: 10, item: '10-32 nut/star washer ' },
    { id: 11, item: 'ILSCO, SGB-4, 4-14 SOL-STR, 35 IN-LBS, ' },
    { id: 12, item: '500 #8 bare copper ' },
    { id: 13, item: 'Burndy #6 to #8 Crimps -YC8C8' },
    { id: 14, item: 'Servit Post 8-2 AWG (3/8" Stud)' },
    { id: 15, item: 'Wire number books ( Ideal ) 1-50' },
    { id: 16, item: 'MC 4- Disconect tool ' },
    { id: 17, item: '1 Plastic Insert bushings ' },
];
class BomDC extends React.Component {
    state = {
        data: datos
    }
    render() {
        return (<>
            <Container>
                <br />
                <Table>
                    <thead><tr>
                        <th>Items</th>
                        <th>PART #</th>
                        <th>ORDER</th>
                    </tr></thead>
                    <tbody>
                        {this.state.data.map((item) => (
                            <tr>
                                <td>{item.item}</td>
                                <td>{item.item}</td>
                                <td>{item.item}</td>
                                <td><Button color='primaty'>Ebitar</Button></td>
                            </tr>
                        ))}
                    </tbody>
                </Table>
            </Container>
        </>
        )
    }
}

export default BomDC

const styles = StyleSheet.create({
    constainer: {
        height: '100%',
        display: 'flex',
        //justifyContent: 'space-between'
    },
    text: {
        textAlign: 'center'
    },
    head: {
        height: 40,
        backgroundColor: 'blue'
    },
    dataRow: {
        height: 30
    },
    border: {
        borderWidth: 0.5,
        borderColor: 'red'
    },
    table: {
        marginTop: 10,
        marginBottom: 10
    }
})
